import './Birthdayusers.css';

 function Birthdayusers (props){
    // {data: {name:'kk'. age:'90'}}
    return(
        <div className='users'>
            <h4>{props.name}</h4>
            <p>{props.age}</p>
        </div>
    )
 }
 export default Birthdayusers;
